The successful candidate needs to be a current university student pursuing an IT degree. The role will be working approximately 20 hours per week and the contract will be for 12 months initially with a good possibility of extending longer. To win this position  you will need to have developed good technical skills in Windows environments and have an understanding of TCP/IP connectivity  Firewalls  MS Office suite (Excel  Word  PowerPoint)  MS Explorer  MS Outlook  etc. It is a bonus if you have any experience in a Help Desk environment  but this is not essential. 

You must have an excellent telephone manner and a logical approach to problem solving  combined with a strong customer service attitude and excellent written and verbal English communication skills. 

You must be a team player  be dependable and be a quick learner. This role requires a security check  so only applicants with Australian Permanent Residency or Citizenship and a clean police record need apply. 

Please note that due to the volume of applicants for this position  only candidates who have been shortlisted will be contacted."', N'Please send cover letter and resume.', NULL, N'www.goballlogistics.com', 0, 0, 0, NULL, NULL, NULL, 1)
