Please note that due to the volume of applicants for this position  only candidates who have been shortlisted will be contacted."', N'Please send cover letter and resume.', NULL, N'www.goballlogistics.com', 0, 0, 0, NULL, NULL, NULL, 1)
INSERT [dbo].[Jobs] ([EntityId], [EmployerId], [RecruitingFor], [HideRecruitingFor], [ContactId], [DisplayContactId], [Commences], [Remuneration], [PositionsAvailable], [ExternalReference], [Details], [Procedures], [MinimumAge], [Url], [IsGradRecruit], [IsVacEmployment], [IsWIL], [Residency], [Notifications_ExpireSent], [ContractType], [ContractHours]) VALUES (95622, 95224, NULL, 0, 95225, NULL, N'ASAP', N'TBA', N'1', NULL, N'"Junior Business Analyst is required for an immediate start for a 6 month contract to assist our client with their core system replacement project for a Student Management System.

To be successful in this role you will be a Junior Business Analyst who has solid end to end business analysis skills including the ability to understand configuration activity and design review documentation. Proven skills with business process mapping and process diagrams (to level 4/5) is also a requirement for this role. Exposure to the education sector and student management systems (or similar) is highly preferred for this position. Excellent communication  documentation and relationship building skills are a must."', N'If youre available to start Immediately  then please send your Resume to Narelle McGennan at email@email.com.au quoting ref: FT5486 ASAP!!', NULL, NULL, 0, 0, 0, NULL, NULL, 0, NULL)
INSERT [dbo].[Jobs] ([EntityId], [EmployerId], [RecruitingFor], [HideRecruitingFor], [ContactId], [DisplayContactId], [Commences], [Remuneration], [PositionsAvailable], [ExternalReference], [Details], [Procedures], [MinimumAge], [Url], [IsGradRecruit], [IsVacEmployment], [IsWIL], [Residency], [Notifications_ExpireSent], [ContractType], [ContractHours]) VALUES (95623, 95224, NULL, 0, 95225, NULL, N'ASAP', N'TBA', N'1', NULL, N'"Megacorp requires a Junior Business Development Manager to join our dedicated and hard working team in Brisbane.

You will be responsible for new sales opportunities and reporting to the General Manager. The BDM is ultimately responsible for all sales generation activity which includes  but is not limited to telemarketing  cold-calling and targeted marketing campaigns as well as managing customer enquiries/expectations and ensuring that targets and growth strategies within the business are developed and achieved. The BDM has defined KPI''s against a monthly sales target and is compensated according to the sales commission structure.

As the successful applicant you will:
* A proactive and positive attitude with a commitment to customer service;
* Excellent communication skills  both oral and written;
* Previous experience in sales preferred (no more than 3 years);
* Graduates preferred;
* Understanding of reporting guidelines with the ability to meet deadlines.

You are required to do:
* Prospect for new business opportunities (90% of your time);
* Prepare quotations and provide solutions to the customer requirements;
* Provide timely input and forecasts to management on prospect portfolio;
* Maintain and update a daily reporting of sales generation activities;
* Monitor and combat competitor activity against personal sales activity."', N'If youre available to start Immediately  then please send your Resume to Narelle McGennan at email@email.com.au quoting ref: FT5486 ASAP!!', NULL, NULL, 0, 0, 0, NULL, NULL, 0, NULL)
INSERT [dbo].[Jobs] ([EntityId], [EmployerId], [RecruitingFor], [HideRecruitingFor], [ContactId], [DisplayContactId], [Commences], [Remuneration], [PositionsAvailable], [ExternalReference], [Details], [Procedures], [MinimumAge], [Url], [IsGradRecruit], [IsVacEmployment], [IsWIL], [Residency], [Notifications_ExpireSent], [ContractType], [ContractHours]) VALUES (95628, 95244, N'M&S', 0, 95245, 95245, N'ASAP', N'TBA', N'1', NULL, N'"M&S has an ongoing requirement for experienced Business Analysts to join its team of consultants in Melbourne. Expressions of interest are now invited from experienced Business Analysts seeking a career in management consulting with Australias leading business and technology services company.

To be considered you would require a relevant tertiary qualification coupled with a number of years of successfully assisting large corporations and government departments in improving existing business processes.

Were seeking people with skills associated with the following :

    * Business requirements gathering
    * Training and mentoring junior business analysts
    * Review existing interfaces
    * Facilitating workshops
    * Mapping current and proposed processes
    * Mitigating data security risks
    * Managing user acceptance testing
    * Engaging SMEs and technical resources
    * Designing and documenting robust interim processes
    * Reviewing reference material
    * Assessing long term production defects

This represents an excellent opportunity for talented and hard working Business Analysts to join the management consulting industry with a progressive company that is growing in size and overseas expansion. SMS also provides in house professional development programs to further enhance your career profile."', N'Via email.', NULL, NULL, 0, 0, 0, NULL, NULL, NULL, 1)
