INSERT [dbo].[Events] ([EntityId], [Title], [Details], [Phone], [Email], [Venue], [Start], [End]) VALUES (3190968, N'Initial Resume Consultation', N'<p>Initial Consultation</p><p>Compulsory session to discuss about your Resume</p>', NULL, NULL, N'TBC', CAST(0x0000A58700000000 AS DateTime), CAST(0x0000A59400107AC0 AS DateTime))
INSERT [dbo].[Events] ([EntityId], [Title], [Details], [Phone], [Email], [Venue], [Start], [End]) VALUES (3194113, N'Standout Resumes Workshop', N'<p>Get the edge on your competitors by learning what employers are looking for in a resume. See examples that demonstrate this  and work on how to promote your relevant skills  accomplishments and potential. This is an interactive workshop to help you take your resume to the next level.</p><p>We encourage you to bring your resume along to this session so you can review changes and additions you could make to present the best possible you on paper. It is anticipated that you will review our online resources on resume development prior to attending so that you come ready to put the principles into practice.</p>', NULL, NULL, N'Brisbane Campus', CAST(0x0000A56B018344A0 AS DateTime), CAST(0x0000A57900107AC0 AS DateTime))
INSERT [dbo].[Events] ([EntityId], [Title], [Details], [Phone], [Email], [Venue], [Start], [End]) VALUES (3194119, N'How to use LinkedIn Improve my Employability', N'<p>LinkedIn can be an extremely powerful tool. &nbsp;In this seminar you will learn how many of LinkedIn''s functions can be used to better optimise your on-line presence  effectively search for job opportunities and extend your professional network.</p>', NULL, NULL, N'Melbourne Campus', CAST(0x0000A56C0041EB00 AS DateTime), CAST(0x0000A579005265C0 AS DateTime))
INSERT [dbo].[Events] ([EntityId], [Title], [Details], [Phone], [Email], [Venue], [Start], [End]) VALUES (3194122, N'Australian Employment', N'<p>Are you one of the many international students who will graduate with the opportunity to remain in Australia to undertake employment? Are you seeking Australian work experience or an internship during your studies? Discover proactive job search strategies that work for international students and graduates and learn the skills and information you need to present yourself with confidence!</p><p>If you have ever felt frustrated by careers fairs and employers advertising roles for ''Australian Citizens or Permanent Residents only''  then this seminar is for you. International students and graduates can experience success in their Australian job search  but will benefit from looking for work differently than local students do. This seminar will assist international students who are considering remaining in Australia post-graduation on the or similar visas  as well as those who are seeking Australian work experience or an internship during their studies.&nbsp;</p><p>Topics covered include:</p><ul><li>Talking to potential employers about your visa status</li><li>Using your research skills to target employers</li><li>Conducting a regional job search from Brisbane</li><li>Building your professional network to increase employment opportunities</li><li>Applying for unadvertised jobs</li></ul>', NULL, N'student-employment@ua.edu.au', N'Sydney Campus', CAST(0x0000A57700000000 AS DateTime), CAST(0x0000A5860020F580 AS DateTime))
